const names = ['PHONTHAKRON', 'MANITA', 'PHIYADA'];

function findPrayuth(_names: string[]) {
  for(let index=0; index < _names.length; index++){
      const element = _names[index];
      if (element === 'Prayuth') {
          console.log('Found Prayuth!');
      }
  }
}
