class QueueNode {
  value: any
  next: QueueNode | null
  constructor(value: any) {
    this.value = value
    this.next = null
  }
}

class Queue {
  first: QueueNode | null = null
  last: QueueNode | null = null
  length: number = 0

  peek() {
      return this.first?.value
  }

  enqueue(value: any) { }

  dequeue() { }
}
