function quickSort(arr: number[], left: number = 0, right: number = arr.length - 1) {
    if (left > right)
        return arr
    const pivot = right 
    const partitionIndex = partition(arr, pivot, left, right) 
    quickSort(arr, left, partitionIndex - 1)
    quickSort(arr, partitionIndex + 1,)
}

